import './App.css';

function App() {
  const personalView = ({onClick}) => (
    <div>
      <h2>About me</h2>
    </div>
  );

  return (
    <div>
      <h1>Dylan McGrann</h1>
      <link to='/personal'>Personal</link>
      <link to='/professional'>Professional</link>
    </div>
  );
}

export default App;
